import React from 'react';
import  './Question.css';

const question = ( props ) => {



    return (
        <div className={'question'}>
            <p onClick={props.click}>{props.question} </p>
            <p>{props.children}</p>
            <input type="text" onChange={props.changed} value = '' />
        </div>
    )
};

export default question;
